(function (my) {
    'use strict';
    /**
     * @namespace
     * @summary Google Analysis plugin for my framework
     * @requires my
     * @requires my.config
     * @author harri@myweb.fi
     */
    my.ga = {
        initialize: function () {
            var trackingCode = my.config.GoogleAnalyticsTrackingCode, createOptions = my.config.GoogleAnalyticsCreateOptions;
            if (typeof trackingCode === 'string') {
                if (trackingCode.match(/^UA-\d*-\d$/)) {
                    my.log('Google Analytics: initializing with code: %s',  trackingCode);
                    (function(i,s,o,g,r,a,m) {
                        i['GoogleAnalyticsObject']=r;
                        i[r]=i[r]||function(){
                            (i[r].q=i[r].q||[]).push(arguments);
                        },
                        i[r].l=1*new Date();
                        a=s.createElement(o);
                        m=s.getElementsByTagName(o)[0];
                        a.async=1;
                        a.src=g;
                        m.parentNode.insertBefore(a,m);
                    })(window,document,'script','//www.google-analytics.com/analytics.js','ga');
                        
                    ga('create', trackingCode, createOptions);
                    my.eventBus.on('application:openView', function (viewName) {
                        ga('send', 'pageview', {page: viewName});
                        ga('send', 'event', 'Navigate', viewName);
                    }, my.ga);
                    my.eventBus.on('application:redirect', function (viewName) {
                        ga('send', 'event', 'Redirect', viewName);
                    }, my.ga);
                    my.eventBus.on('application:error', function (errorText) {
                        ga('send', 'event', 'Error', errorText);
                    }, my.ga);
                    my.eventBus.on('application:warn', function (warningText) {
                        ga('send', 'event', 'Warning', warningText);
                    }, my.ga);
                    my.eventBus.on('application:action', function (actionName) {
                        ga('send', 'event', 'Action', actionName);
                    }, my.ga);
                    my.eventBus.on('created', function (model) {
                        ga('send', 'event', 'Create', model.name);
                    });
                    my.eventBus.on('updated', function (model) {
                        ga('send', 'event', 'Create', model.name);
                    });
                    my.eventBus.on('destroyed', function (model) {
                        ga('send', 'event', 'Create', model.name);
                    });
                    my.log('Google Analytics initialized');
                    my.eventBus.trigger('application:action', 'init');
                } else {
                    my.log('Google Analytics is not in use');
                }
            }
        }
        // declare your namespace here
    };
    my.eventBus.once('application:initialized', my.ga.initialize, my.ga);
}(my));


