/*global my, Backbone, jQuery, _ */

(function (my) {
    'use strict';
    /**
     * @namespace
     * @summary My namespace for recaptcha implementation
     * @author harri@myweb.fi
     */
    my.recaptcha = {
        // declare your namespace here
        create: function ($placeholder) {
            var session = my.app.getSession();
            // If the session contains hasPassedRecaptcha -> we trust the 
            // browser, since the attacker will end up to 503 in 
            // ReCaptchaFilter,  if the real session does not contain 
            // hasPassedReCaptcha.
            // TODO: For now the session is always empty -> recaptcha
            // will be shown always
            if (session.getAttribute('hasPassedRecaptcha') !== true) {
                Recaptcha.create("6Le1DeMSAAAAAMPKUT254N6RxLLYzns90eUhFYod",
                    $placeholder[0],
                    {
                      theme: "clean",
                      callback: Recaptcha.focus_response_field
                    }
                  );
            }

        },
        check: function (successCallback, failureCallback, context) {
            jQuery.ajax({
                type: "POST",
                url: my.config.recaptchaCheckPath,
                data: {challenge: Recaptcha.get_challenge(), response: Recaptcha.get_response()},
                context: context,
                success: function (data, textStatus, xhr) {
                    if (data && data.valid === true) {
                        successCallback.call(this, data);
                    } else {
                        my.log('my.recaptcha.check: success with data %o', data);
                        Recaptcha.reload();
                        failureCallback.call(this, data);
                    }
                },
                error: function (jqXHR, textStatus, errorThrown) {
                    my.unused(jqXHR);
                    my.log('my.recaptcha.check: failure with error %s', errorThrown);
                    Recaptcha.reload();
                    failureCallback.call(this, errorThrown);
                }
            });
        }
    };
}(my));


